import React, { Component } from 'react';
import fire from '../config/Fire';

class Cards extends Component {
    constructor(props) {
        super(props);
        this.logout = this.logout.bind(this);
    }

    logout() {
        fire.auth().signOut();
    }

    render() {
        return (<h1>Your cards are:</h1>);
    }
}

export default Cards
